const frogsData  = require('../data/frogsData.json');

function frogs(){
    let frogy = [];
    for(let f in frogsData){
        var img = frogsData[f]['image'];
        var imgy = { uri: img }
        let frogCleanse = {
            'id': frogsData[f]['id'],
            'name': frogsData[f]['name'],
            "image": imgy
        }
        frogy.push(frogCleanse);
    }
    
    return frogy;
}
export default frogs;
